Learning PHP, MySQL, JavaScript, CSS &amp; HTML5: A Step-by-Step Guide to Creating Dynamic Websites (3rd edition)

2014 | ISBN-10: 1491949465 | 730 pages | PDF, EPUB, MOBI | 59 MB 

Build interactive, data-driven websites with the potent combination of open-source technologies and web standards, even if you only have basic HTML knowledge. 

With this popular hands-on guide, you'll tackle dynamic web programming with the help of today's core technologies: PHP, MySQL, JavaScript, CSS, and HTML5.
